import React from 'react'
import { useParams } from 'react-router-dom'
import { useState, useEffect } from 'react'
import axios from 'axios'
import ravintolat1 from './components/RavintolaLista'


export default function RavintolaIDnakyma() {

    const idd = useParams();
    console.log(idd);
    const ravintola = ravintolat1.find(n => n.idd === idd.idd);
    if (ravintola == null){
        return <div>No matching ravintola</div>
    }
  return (
      <div>
          <div>Täältä löytyy ravintola {ravintola.title}  tiedot.
          </div>
      </div>
    
  )
}
